import React from "react";
import { FaHeartbeat, FaBone, FaBrain, FaHandsHelping } from "react-icons/fa";
import { Tooltip } from "react-tooltip-lite"; // Optional tooltip lib
import { useNavigate } from "react-router-dom";
import "./Dashboard.css"; // if you want custom CSS additions

const exerciseData = [
  {
    title: "Cardiac Rehab",
    icon: <FaHeartbeat color="#d90429" size={30} />,
    label: "Cardiac",
    color: "from-red-400 to-pink-500",
    exercises: [
      "Marching in Place",
      "Chair Squats",
      "Arm Circles",
      "Leg Raises",
      "Wall Push-ups",
    ],
  },
  {
    title: "Orthopedic Rehab",
    icon: <FaBone color="#6a994e" size={30} />,
    label: "Orthopedic",
    color: "from-green-400 to-emerald-500",
    exercises: [
      "Side Leg Lifts",
      "Elbow Extensions",
      "Chair Squats",
      "Shoulder Rolls",
    ],
  },
  {
    title: "Neuro Rehab",
    icon: <FaBrain color="#4f46e5" size={30} />,
    label: "Neurological",
    color: "from-indigo-500 to-purple-600",
    exercises: [
      "Seated Twists",
      "Shoulder Rolls",
      "Arm Circles",
      "Leg Raises",
    ],
  },
  {
    title: "Physiotherapy",
    icon: <FaHandsHelping color="#db6400" size={30} />,
    label: "General",
    color: "from-yellow-400 to-orange-500",
    exercises: [
      "Chair Squats",
      "Arm Circles",
      "Shoulder Rolls",
      "Leg Raises",
    ],
  },
];

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-blue-700 text-white p-5 flex justify-between items-center shadow-md">
        <h1 className="text-2xl font-bold tracking-wide">AI Rehab Dashboard</h1>
        <nav className="space-x-4">
          <a href="#" className="hover:underline">Home</a>
          <a href="#" className="hover:underline">Profile</a>
          <a href="#" className="hover:underline">Logout</a>
        </nav>
      </header>

      {/* Main Grid */}
      <main className="p-6 grid gap-6 grid-cols-1 sm:grid-cols-2 lg:grid-cols-2 xl:grid-cols-3 animate-fadeIn">
        {exerciseData.map((card, index) => (
          <div
            key={index}
            className={`rounded-xl p-5 shadow-lg bg-gradient-to-tr ${card.color} text-white transition-transform transform hover:scale-105 hover:shadow-2xl`}
          >
            <div className="flex items-center justify-between mb-4">
              <div className="flex items-center space-x-3">
                {card.icon}
                <h2 className="text-xl font-semibold">{card.title}</h2>
              </div>
              <span className="bg-white text-black text-xs px-2 py-1 rounded-full font-medium">
                {card.label}
              </span>
            </div>

            <ul className="space-y-1 text-sm mb-4">
              {card.exercises.map((ex, i) => (
                <li key={i} className="flex items-center justify-between">
                  {ex}
                  <Tooltip content="Trackable with webcam" direction="right">
                    <span className="ml-2 text-xs text-white bg-black bg-opacity-30 px-2 py-0.5 rounded">i</span>
                  </Tooltip>
                </li>
              ))}
            </ul>

            <button
              className="start-button mt-2 w-full bg-white text-black hover:bg-black hover:text-white py-2 rounded-lg font-semibold transition-all"
              onClick={() => navigate("/exercise")}
            >
              Start
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
